import React, { useRef, useEffect } from 'react';
import { motion } from 'framer-motion';
import CrystalBall from '../CrystalBall';

const AboutPanel = () => {
  const crystalBallAlignStyle = { marginTop: '2px' };

  const experienceSteps = [
    {
      title: 'MyOpini, Frontend Developer - Intern',
      sub: 'April 2025 – Present',
      desc: 'Leading frontend development, implementing complex designs, optimizing performance, integrating smart contracts, and mentoring an intern for scalable, high-quality project delivery.'
    },
    {
      title: 'Dev3Pack Fellow',
      sub: 'June 2025 – Present',
      desc: 'Selected for a web3 builder fellowship, collaborating on decentralized projects with developers from web2 backgrounds.'
    },
    {
      title: 'SheFi Scholar',
      sub: 'Feb 2025 – April 2025',
      desc: 'Awarded a scholarship to join a global women-led Web3 cohort, engaging in hands-on DeFi and blockchain learning.'
    }
  ];

  return (
    <div className="w-full h-full overflow-y-auto px-4 py-6">
      <motion.h2
        className="text-3xl md:text-4xl font-bold text-center mb-6"
        style={{
          background: 'linear-gradient(45deg, #FFB6C1, #E6E6FA)',
          WebkitBackgroundClip: 'text',
          WebkitTextFillColor: 'transparent',
          backgroundClip: 'text',
        }}
        initial={{ opacity: 0, y: 30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        About Me
      </motion.h2>

      <motion.div
        className="mb-6"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6, delay: 0.2 }}
      >
        <p className="text-base md:text-lg mb-4" style={{ color: '#FDF6E3', textAlign: 'justify' }}>
          I'm an AI and Data Science engineering student exploring how Web3, AI, and creativity can
          come together to build useful, meaningful things. I enjoy working on projects that
          solve real problems at the intersection of AI and Web3.
        </p>
        <p className="text-base md:text-lg mb-4" style={{ color: '#FDF6E3', textAlign: 'justify' }}>
          Outside of building, I like experimenting with new Web3 tools and protocols,
          and being part of communities that support and teach each other in the decentralized space.
          I'm still figuring things out, but I'm here to grow, stay curious, and keep building the future of the web.
        </p>
      </motion.div>

      <div
        className="flex flex-col md:flex-row gap-6 mt-6"
        style={{ maxWidth: '900px', margin: '0 auto' }}
      >
        {/* Education Section */}
        <div className="flex-1">
          <div
            className="mb-3 text-sm font-bold uppercase tracking-wider"
            style={{
              color: '#fff',
              textShadow: '0 0 3px #FFB6C1, 0 0 6px rgba(255, 255, 255, 0.2)',
            }}
          >
            Education
          </div>
          <div className="flex flex-col gap-4">
            {[
              {
                title: 'B.E in Artificial Intelligence and Data Science',
                sub: 'VESIT, Mumbai – 2022 – 2026'
              },
              {
                title: 'HSC Science',
                sub: 'Kendriya Vidyalaya, Nashik – Completed in 2022'
              },
              {
                title: 'SSC Science',
                sub: 'Kendriya Vidyalaya, Nashik – Completed in 2020'
              }
            ].map((step, idx) => (
              <div
                key={idx}
                className="w-full rounded-2xl p-4 flex flex-row items-start gap-3"
                style={{
                  background: 'rgba(255,255,255,0.06)',
                  boxShadow: '0 2px 16px 0 rgba(179,157,219,0.08)',
                  border: '1px solid rgba(179,157,219,0.12)',
                  transition: 'all 0.3s',
                  cursor: 'pointer',
                }}
                onMouseEnter={(e) => {
                  e.currentTarget.style.boxShadow = '0 0 6px 0 #FFB6C1, 0 1px 8px 0 rgba(179,157,219,0.08)';
                  e.currentTarget.style.transform = 'translateY(-4px) scale(1.025)';
                }}
                onMouseLeave={(e) => {
                  e.currentTarget.style.boxShadow = '0 2px 16px 0 rgba(179,157,219,0.08)';
                  e.currentTarget.style.transform = 'none';
                }}
              >
                <div style={{ flexShrink: 0, ...crystalBallAlignStyle }}>
                  <CrystalBall size={38} />
                </div>
                <div className="flex flex-col gap-1">
                  <div className="font-bold text-sm" style={{ color: '#FFB6C1', lineHeight: 1.2 }}>
                    {step.title}
                  </div>
                  <div className="text-xs" style={{ color: '#fff', textAlign: 'justify' }}>
                    {step.sub}
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Experience Section */}
        <div className="flex-1">
          <div
            className="mb-3 text-sm font-bold uppercase tracking-wider"
            style={{
              color: '#fff',
              textShadow: '0 0 3px #FFB6C1, 0 0 6px rgba(255, 255, 255, 0.2)',
            }}
          >
            Experience
          </div>
          <div className="flex flex-col gap-4">
            {experienceSteps.map((step, idx) => (
              <div
                key={idx}
                className="w-full rounded-2xl p-4 flex flex-row items-start gap-3"
                style={{
                  background: 'rgba(255,255,255,0.06)',
                  boxShadow: '0 2px 16px 0 rgba(255,209,220,0.08)',
                  border: '1px solid rgba(255,209,220,0.12)',
                  transition: 'all 0.3s',
                  cursor: 'pointer',
                }}
                onMouseEnter={(e) => {
                  e.currentTarget.style.boxShadow = '0 0 6px 0 #FFB6C1, 0 1px 8px 0 rgba(255,209,220,0.08)';
                  e.currentTarget.style.transform = 'translateY(-4px) scale(1.025)';
                }}
                onMouseLeave={(e) => {
                  e.currentTarget.style.boxShadow = '0 2px 16px 0 rgba(255,209,220,0.08)';
                  e.currentTarget.style.transform = 'none';
                }}
              >
                <div style={{ flexShrink: 0, ...crystalBallAlignStyle }}>
                  <CrystalBall size={38} />
                </div>
                <div className="flex flex-col gap-1">
                  <div className="font-bold text-sm" style={{ color: '#FFB6C1', lineHeight: 1.2 }}>
                    {step.title}
                  </div>
                  <div className="text-xs" style={{ color: '#fff', textAlign: 'justify' }}>
                    {step.sub}
                  </div>
                  <div className="text-xs mt-1" style={{ color: '#fff', textAlign: 'justify' }}>
                    {step.desc}
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default AboutPanel;
